import React, { Fragment, useEffect } from 'react';
import { PropTypes } from 'prop-types';
import { connect } from 'react-redux';
import { getCurrentProfile } from './../../actions/profile';
import Spinner from '../layout/Spinner';

const Dashboard = props => {
  useEffect(() => {
    props.getCurrentProfile();
  }, []);

  return props.profile.loading && props.profile.profile === null ? 
        <Spinner /> : <Fragment> <h1 className="large text-primary">
         Dashboard </h1> <p className="lead"> </p>
        <i className="fas fa-user"></i> Welcome {props.auth.user && props.auth.user.name } 
        {props.profile.profile !== null ? <Fragment> has </Fragment> : <Fragment> has not </Fragment> }  
       </Fragment>
}

Dashboard.propTypes = {
  getCurrentProfile: PropTypes.func.isRequired,
  auth: PropTypes.object.isRequired,
  profile: PropTypes.object.isRequired
}
 
const mapStateToProps = state => ({  
  auth: state.auth,
  profile: state.profile
})

export default connect(mapStateToProps,  {getCurrentProfile})(Dashboard);
